import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

const root = ReactDOM.createRoot(document.querySelector('#root'));
root.render(
    <>
      <h1>Shivam Varshney</h1>
      <p>this is my react app</p>
      <ol>
        <li></li>
      </ol>
    </>
);
